import React from 'react';
import '../css/main.css';

function VisitsRowTable(props) {
    return (
        <tr className="table__row--body" data-id={props.id}>
            <td className="table__cell table__cell--body">{props.name}</td>
            <td className="table__cell table__cell--body">{props.company}</td>
            <td className="table__cell table__cell--body">{props.visits}</td>
            <td className="table__cell table__cell--body">{props.views}</td>
        </tr>
    );
}

export default VisitsRowTable;
